import React from 'react';
import headshot from '../images/Headshot.jpg';

export default function Conversation(props: any) {
    var [ clicked, setClick ] = React.useState(false);

    return( 
        <div className="conversation" onClick={() => setClick(!clicked)} style={clicked ? {background: "rgb(54, 134, 237)"} : {background: "none"}}>
            <div className="image-container">
                <img className="image" src={headshot}/>
            </div>
            <div className="conversation-content" onClick={() => setClick(!clicked)} style={clicked ? {borderBottom: "none"} : {borderBottom: "1px solid rgb(172, 172, 172)"}}>
                <div className="content-top">
                    <h5>Jared Min</h5>
                    <p>Yesterday</p>
                </div>
                <p>This is a sample text.</p>
            </div>
        </div>
    )
}
